(1, '0x00000000000b7f8e8e8ad148f9d53303bfe20796', 'ERC721', 'zLoot', '0xb776cab26b9e6be821842dc0cc0e8217489a4581', 'zLoot', 'zLoot is randomized survivors gear generated and stored on chain. Stats, images, and other functionality are intentionally omitted for others to interpret. Feel free to use zLoot in any way you want.', 'COL_0x00000000000b7f8e8e8ad148f9d53303bfe20796.jpeg', '2022-04-20 15:05:32', '2022-04-20 15:05:32'),
(2, '0x0000000005756b5a03e751bd0280e3a55bc05b6e', 'ERC721', 'Villagers of XOLO', '0x3fe98707898a91f5734790f3fcf1492a3b937d1a', 'Villagers of XOLO', 'In the year 2069, Earth has become desolate and uninhabitable as the last remnants of humanity ready themselves to venture out into the cosmos to find a new home. Upon arriving at their destination of the planet XOLO, the crew of the E.S.C. JOURNEY are forced to prepare themselves for a crash landing. Follow the tales and adventures of the remaining crew as they try to overcome obstacles they may face. Villagers of XOLO is a generative collection on the Ethereum blockchain and the first set of the JRNY Club ecosystem. ', 'COL_0x0000000005756b5a03e751bd0280e3a55bc05b6e.jpeg', '2022-04-20 15:06:20', '2022-04-20 15:06:20'),
(3, '0x0000000010c38b3d8b4d642d9d065fb69bc77bc7', 'ERC1155', 'underground', '0x75989893bfa48f54e59a6f3020fed3878cc8bad9', 'underground', 'A private, members-only collective of 785 talented traders and investors looking to disrupt and define NFT culture. Membership to the organization and all benefits until June 30, 2023 come from holding the Underground S1 Access Pass NFT.', 'COL_0x0000000010c38b3d8b4d642d9d065fb69bc77bc7.png', '2022-04-20 15:26:47', '2022-04-20 15:26:47'),
(4, '0x00000000fffd97acdc8c5585c818f6b0f946c0ed', 'ERC721', 'Rare QRs', NULL, 'Rare QRs', '64 Immutable QR Codes that link to themselves on OpenSea, with the IPFS hashes of the metadata permanently committed to the blockchain.', 'COL_0x00000000fffd97acdc8c5585c818f6b0f946c0ed.png', '2022-04-20 15:26:58', '2022-04-20 15:26:58'),
(5, '0x000000059619cdddc056910672abc90887136a95', 'ERC721', 'SeKira', '0x719d131dfd468bdba4c97529eeb39d9c95db5e59', 'SeKira', 'üå∏ 5,555 Generative collection inspired by Japan üå∏\n\nS„ÅÆKIRA is an NFT Collection of 5,555 Generative female character inspired by Japan. Our aim is to build a culture based community that is different from all other projects, with our members defining S„ÅÆKIRA, represent S„ÅÆKIRA and become S„ÅÆKIRA.¬†', 'COL_0x000000059619cdddc056910672abc90887136a95.jpeg', '2022-04-20 15:30:51', '2022-04-20 15:30:51');
